import '../App.css';
import Button from "../Components/Button.js";
import PedImg from '../Components/Images/PedImg.js';
import Blogo from '../Components/Images/Blogo';
import Footer from "../Components/Footer.js";
import {FaLinkedin, FaGithub} from "react-icons/fa";
import Homeheader from '../Components/Homeheader';
import "./Home.css";


function Home() {
  return (
    <div className="home">
      <div className="home--header">
        <PedImg />
        <div className="header--items">
          <Homeheader />
          </div>
      </div>
      <div className="buttons">
        <Button buttonStyle="btn--aboutme">About Me</Button>
        <Button buttonStyle="btn--projects">Projects</Button>
        <Button buttonStyle="btn--resume">Resume</Button>
      </div>
      <div className="home--logos">
        <Blogo />
        <FaGithub className="gitty"/>
        <FaLinkedin className="linkdy"/>
      </div>
    </div>
  );
}

export default Home;
